import NavItem from "./NavItem";

// const props = ['Home', 'Catalog', 'About', 'Contacts'];

export default function Navbar (){
    return(
        <nav-bar>
            <NavItem />
            <NavItem>Catalog</NavItem>
            <NavItem>About</NavItem>
            <NavItem>Contacts</NavItem>
        </nav-bar>
    );
}
